import React from 'react';
import Card from "./Card"

class CardList extends React.Component{
    render(){
        return(
            <div>
                {
                    this.props.robots2.map(function hello(user,i) {
                        return(
                        <div> <Card id={this.props.robots2[i].id} name={user[i].name} email={user[i].email} />  </div> 
                        )
                    })
                }
            </div>
        )
    }
}
export default CardList
